import React from 'react'
import './Sidebar.css';
import { Announcement, ShowChart, AccountBalance, Adb } from '@material-ui/icons';


function Sidebar() {
    return (
        <div className="sidebar">
            <ul>
                <li className="logo"><Adb fontSize="large" /></li>
                <li className="active"><Announcement fontSize="large"/></li>
                <li><ShowChart fontSize="large"/></li>
                <li><AccountBalance fontSize="large"/></li>
            </ul>
        </div>
    )
}

export default Sidebar
